.social__item--vk {
  background-image: url("/a1b977869709a3301b937ab4ec639c85.svg");
}

.background-img {
  position: relative;
}
.background-img .sun-bg {
  max-width: 200px;
  position: absolute;
  bottom: 0;
  left: 50%;
  height: auto;
  transform: translate(-50%, -70%);
  z-index: 0;
}
