@import "fonts.scss";
@import "variable";
@import "mixins";
@import "scss/bootstrap-reboot";
@import "scss/bootstrap-grid";
// @import "particles.scss";

body {
  font-family: "Sofia Pro", serif;
  font-size: 16px;
  color: $main-text-color;
  @media screen and (max-width: 576px) {
    font-size: 10px;
  }
}

ul,
li {
  list-style-type: none;
}

a {
  text-decoration: none;
  color: inherit;
}
ul {
  margin-bottom: 0;
}
img {
  width: 100%;
  height: 100%;
}
.btn {
  border: none;
  font-size: 1rem;
  font-weight: bold;
  color: #fff;
  background-color: $main-color;
  box-shadow: 0px 15px 25px rgba(0, 157, 152, 0.25);
  border-radius: 4px;
  display: block;
  width: max-content;
  cursor: pointer;
  transition: all 0.5s cubic-bezier(0.075, 0.82, 0.165, 1);
  &:hover {
    transform: scale(1.02);
  }
}
.hero {
  &__bg {
    width: 100%;
    position: absolute;
    bottom: 0;
    left: 0;
  }
  background-color: rgba(0, 168, 204, 0.1);
  overflow: hidden;
  padding-top: 2rem;
  min-height: 100vh;
  width: 100%;
  position: relative;

  // END IMAGES
  // NAVIGATION

  &__nav {
  }
  &__title {
    h1 {
      font-family: "Poppins", sans-serif;
      font-size: 4.375rem;
      line-height: 5rem;
      font-weight: 900;
      -webkit-text-stroke-width: 2px;
      -webkit-text-stroke-color: #083c4c;
      -webkit-text-fill-color: white;
      margin-top: 10rem;
      @media screen and (max-width: 992px) {
        font-size: 3rem;
      }
      @media screen and (max-width: 576px) {
        font-size: 2rem;
        line-height: 3rem;
      }
    }
  }
}
.cloud-first,
.cloud-second {
  height: auto;
  width: 66%;
  position: absolute;
  top: -36px;
  right: 0;
}
.white-cloud {
  position: absolute;
  height: 3.125rem;
  opacity: 0.5;
}
.first {
  right: -43%;
  top: 10%;
}
.second {
  right: -29%;
  top: 27%;
  opacity: 0.8;
}
.third {
  right: 19%;
  top: 16%;
  opacity: 1;
}
.cliff {
  position: absolute;
  width: 36%;
  height: 10rem;
  bottom: 0%;
  left: 41%;
  z-index: 1;
  @media screen and (max-width: 576px) {
    bottom: -5%;
  }
  @media screen and (max-width: 992px) {
    bottom: -3%;
  }
}
.mountains {
  position: absolute;
  width: 100%;
  height: auto;
  bottom: 0;
  left: 0;
  z-index: 0;
}
.people {
  position: absolute;
  height: auto;
  width: 25%;
  bottom: 2%;
  left: 45%;
  z-index: 3;
  @media screen and (max-width: 992px) {
    bottom: 5%;
  }
  @media screen and (max-width: 1400px) {
    bottom: 1%;
  }
}
.menu {
  display: flex;
  &__item {
    margin-left: 1.8rem;
    // @include flex-center;
