    color: #000;
  }
}

.nav {
  z-index: 10;
  position: relative;
  @include flex-between;
  align-items: center;

  &__logo {
    @include flex-center;
    color: $main-color;
    font-size: 1.8rem;
    font-weight: bold;
    position: relative;
    padding-left: 25px;
  }
  &__logo-link:hover {
    color: inherit;
  }
  &__logo-img {
