  background-color: $bg-color;
  z-index: 0;
  position: relative;
  &__date {
    background-image: url("../img/calendar\ \(1\)\ 1.svg");
    background-repeat: no-repeat;
    background-position: 90% 50%;
  }
  &__location {
    background-image: url("../img/placeholder 1.svg");
    background-repeat: no-repeat;
    background-position: 90% 50%;
  }
  &__travel {
    background-image: url("../img/passenger\ 1.svg");
    background-repeat: no-repeat;
    background-position: 90% 50%;
  }
  &__wrapper {
    position: relative;
    width: min-content;
    display: flex;
    justify-content: flex-end;
    margin-left: auto;
    margin-right: 3rem;
    padding: 3rem;
    background: #fff;
    border-color: transparent;
    border-top-left-radius: 50px;
    border-bottom-right-radius: 50px;
    @media screen and (max-width: 992px) {
      padding: 1rem;
      flex-direction: column;
      width: 90%;
      & > * {
        margin: 1rem 0;
        padding: 0;
      }
    }
    & > *:not(:last-child) {
      margin-left: 1.1rem;
      margin-right: 0;
      padding: 0.8rem 1.2rem;
      border: 1px solid $main-text-color;
      border-radius: 5px;
      outline: none;
    }
  }
  &__box {
    position: absolute;
    z-index: -1;
    bottom: -50px;
    left: -40px;
  }
}


.about {
  padding-top: 8rem;
  background: $bg-color;
  position: relative;
  #tsparticles{
    position: absolute;
    top: 0;
    right: 0;
    width: 50%;
    height: 100%;
    z-index: -1;
    @media only screen and (max-width: 768px) {
      width: 100%;
    }

  }
  &__box {
    position: absolute;
    top: -30px;
    left: -10px;
    z-index: -1;
  }
  &__img {
    position: relative;
    height: 100%;

  }
  &__circles {
    position: absolute;
    top: 30%;
    left: -25%;
    z-index: -1;
  }
  &__title {
    color: $main-color;
    font-weight: 900;
    font-size: 2.5rem;
  }
  &__content {
    display: flex;
    flex-direction: column;
    justify-content: center;
    & > * {
      margin-bottom: 2rem;
    }
  }
  &__btn {
    padding: 0.8rem 1.8rem;
    &:hover {
      color: #fff;
    }
  }
}

.cost-travel {
  padding: 8rem 0 0rem;
  background-color: $bg-color;
  position: relative;
  background-image: url("../img/cloud.svg");
  background-repeat: no-repeat;
  background-size: cover;
  background-position: center;
  @media only screen and (min-width: 1900px) {
    padding: 10rem 0;
  }
  @media only screen and (max-width: 768px) {
    padding: 1rem 0;
  }
}

.carousel-header {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 4rem;
  z-index: 1;
  @media only screen and (max-width: 768px) {
    flex-direction: column;
    justify-content: center;
  }
  &__title {
    color: $title-color;
    @media only screen and (max-width: 768px) {
      margin-bottom: 2rem;
    }
    h3 {
      font-weight: 900;
      font-size: 2.5rem;
    }
  }
  &__button {
    height: min-content;
    padding: 1rem 1.1rem;
  }
}

.carousel {
  display: flex;
  flex-direction: column;
  position: relative;
  // &__inner {
  //   display: flex;
  // }
  &__button {
    display: flex;
    justify-content: center;
    margin: 2rem 0;
    @media only screen and (min-width: 1400px) {
      padding: 5rem 0;
    }
  }
  &__btn {
    margin: 1rem;
    border-radius: 50%;
    width: 45px;
    height: 45px;
    cursor: pointer;
    background-repeat: no-repeat;
    background-position: center center;
    &--next {
      background-image: url("../img/next-arrow.svg");
    }
    &--prev {
      background-image: url("../img/prev-arrow.svg");
    }
  }
}
.card {
  // flex: 0 0 420px;
  padding: 0 1rem;
  z-index: 1;
  &__img {
    border-radius: 20px;
    height: 420px;
    object-fit: cover;
    overflow: hidden;
    img {
      object-fit: cover;
    }
  }
  &__city {
    margin-top: 2rem;
    display: flex;
    justify-content: space-between;
    align-items: center;
    flex-wrap: wrap;
  }
  &__title {
    flex: 1 0 50%;
    color: $title-color;
    font-weight: 900;
    font-size: 2rem;
  }
  &__star {
    flex: 1 0 50%;
    display: flex;
    justify-content: flex-end;
    height: 20px;
    padding: 0.1rem;
    & > img {
      width: 20px;
    }
  }
  &__subtile {
    flex: 1 0 100%;
  }
  &__price {
    display: flex;
  }
}

.price {
  color: $main-color;
  display: flex;
  justify-content: space-between;
  align-items: center;
  line-height: 2rem;
  &__total {
    flex: 1;
    text-align: right;
    font-weight: bold;
    font-size: 1.5rem;
  }
}

.icon {
  margin-right: 1rem;
  &__img {
    margin-right: 0.5rem;
  }
}

.deals {
  padding: 8rem 0;
  &__card {
    padding: 0.6rem;
  }
  &__img {
    height: 330px;
    object-fit: cover;
    border-radius: 8px;
  }
  &__time {
    display: flex;
    margin-top: 2rem;
    i {
      display: block;
      width: 20px;
      height: 20px;
    }
    p {
      margin-left: 1.5rem;
      font-size: 1.2rem;
    }
  }
  &__title {
    color: #000;
    font-weight: 600;
    line-height: 2rem;
    max-width: 220px;
  }
  &__price {
    font-weight: 600;
    font-size: 2rem;
    line-height: 3rem;
    color: #009d98;
  }
}

.form-section {
  color: #fff;
  padding: 6.25rem 0;
  background-color: rgba(8, 60, 76, 0.5);
  background-image: linear-gradient(rgba(8, 60, 76, 0.5), rgba(8, 60, 76, 0.5)), url("../img/form-bg.jpg");
  background-repeat: no-repeat;
  background-size: cover;
  background-position: center;
  position: relative;
  z-index: 0;
  @media (max-width: 768px) {
    padding: 1rem 0;
  }
}
.address {
  align-self: center;
  @media (max-width: 768px) {
    text-align: center;
  }
  &__title {
    font-weight: bold;
    font-size: 2rem;
    line-height: 50px;
    margin-bottom: 2rem;
  }
  &__info {
    line-height: 46px;
    font-weight: 400;
    @media (max-width: 768px) {
      line-height: 1.5rem;
    }
  }
}

.form {
  display: flex;
  flex-direction: column;
  max-width: 100%;
  @media (max-width: 768px) {
    text-align: center;
    margin: 0 auto;
  }
  &__btn {
    padding: 0.6rem 3rem !important;
    margin-top: 30px;
    background-color: $main-color !important;
  }
  label {
    font-family: "Sofia Pro";
    font-weight: normal;
    font-style: normal;
    line-height: 2.5rem;
  }
  label:not(:first-child) {
    margin-top: 1.4rem;
    @media (max-width: 768px) {
      margin-top: 0rem;
    }
  }
  input,
  textarea {
    border: none;
    outline: none;
    padding: 0.9rem 1rem;
    background: rgba(0, 0, 0, 0.5);
    box-shadow: 0px 10px 50px rgba(19, 15, 64, 0.1);
    border-radius: 4px;
    color: #fff;
    min-width: 100%;
    transition: all 0.5s ease-in-out;
    &:focus {
      background: #ffffff;
      color: #000;
    }
  }
  textarea {
    resize: none;
  }
}

.footer {
  padding-top: 8rem;
  color: #fff;
  background: linear-gradient(#fff, #e5e5e5);
  overflow: hidden;
  @media (max-width: 425px) {
    padding-top: 2rem;
  }
  &__bg {
    padding-top: 500px;
    height: 100%;
    width: 100%;
    background: linear-gradient(
      0deg,

      #009993 0%,
      #009D98 50.43%,
      #c3d7b4 55.16%,
      rgba(232, 239, 226, 0) 94%
    );
  }
  &__companies {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    margin-bottom: 8rem;
    @media (max-width: 425px) {
      align-items: center;
      justify-content: center;
    }
  }
  &__company {
    flex: 0 1 40px;
    padding: 2rem 3rem;
  }
  &__support {
    display: block;
    line-height: 2rem;
  }
  &__content {
    position: relative;
    z-index: 5;
  }
  &__copirighting {
    border-top: 1px solid #fff;
    padding: 2rem 0;
    font-style: normal;
    font-weight: normal;
    font-size: 16px;
    line-height: 26px;
    text-align: center;
  }
}

.social {
  display: flex;
  margin-bottom: 3rem;
  &__item {
    width: 20px;
    height: 20px;
    margin-right: 1.8rem;
    background-repeat: no-repeat;
    background-position: center;
    transition: all 0.3s ease-in;
    &:hover {
      transform: scale(1.2) translateY(-5px);
    }
    &--fb {
      background-image: url("../img/fb.svg");
    }
    &--tw {
      background-image: url("../img/tw.svg");
    }
    &--vk {
      background-image: url("../img/vk.svg");
    }
  }
}

.background-img {
  position: relative;

  .sun-bg {
    max-width: 200px;
    position: absolute;
    bottom: 0;
    left: 50%;
    height: auto;
    transform: translate(-50%, -70%);
    z-index: 0;
  }
  .up-bg {
    position: absolute;
    bottom: 0;
    left: 0;
    height: auto;
    transform: translate(0, 30%);
    z-index: 2;
  }
  .back-bg {
    position: absolute;
    height: auto;
    bottom: 0;
    left: 0;
    z-index: 1;
    transform: translate(0, -30%);
  }
}

